import React from 'react';
import './testApp.scss';
import TestUserProfile from './testComponents/testUser-profile/testUser-profile.component';
import TestUserList from './testComponents/testUser-List/testUser-list.component';

function TestApp(){
    return (
        <div className="App">
            <TestUserList 
                dataSource='https://jsonplaceholder.typicode.com/users'/>
            <TestUserProfile 
                 name="Jampa" 
                 email="jampa@gmail.com" 
                 dataSource='https://jsonplaceholder.typicode.com/posts' />
        </div>
    );
}
export default TestApp;
